    }, 1150);
});

if (localStorage.getItem("#recommended_slots")) {
    $("#recommended_slots").slideUp();
    $('.button_rigft_block[data-id="#recommended_slots"]').addClass("activ");
}

if (localStorage.getItem("#wrapper_histori_jackpots_rigft_block")) {
    $("#wrapper_histori_jackpots_rigft_block").slideUp();
    $('.button_rigft_block[data-id="#wrapper_histori_jackpots_rigft_block"]').addClass("activ");
}

var provider_act = "*";

function provider_activ(e) {
    if (provider_act != $(e).data('provider')) {
        provider_act = $(e).data('provider');
        $('.new_games.games, #provider_activ').fadeOut(300);
        $('.providers div').removeClass();
        $(e).addClass("activ");

        setTimeout(function() {
            $.ajax({
                url: '/provider_activ',
                type: "POST",
                data: {
                    'provider': $(e).data('provider'),
                },
                success: function(data) {
                    if (data.success == true) {
                        var html_slots = "";
                        data.slots.forEach(function(item, i, arr) {
                            console.log(item.title);
                            html_slots += `
                            <div class="all_games_item">
                                <div class="all_games_item_img" style="background: url(https://cdn.softswiss.net/i/s2/softswiss/` + item.identifier2 + `.png) 0 0 / 100% 100% no-repeat;">
                                    <div class="all_games_item_img_button">
                                        @auth
                                        <div class="all_games_item_img_button_play" data-href="/slot/` + item.id + `/real_dynamics" onclick="dynamics(this);">Играть</div>
                                        <div class="all_games_item_img_button_demo" data-href="/slot/` + item.id + `/demo_dynamics" onclick="dynamics(this);">Демо</div>
                                        @else
                                        <div class="all_games_item_img_button_demo all_games_item_img_button_demo_auto" data-href="/slot/` + item.id + `/demo_dynamics" onclick="dynamics(this);">Демо</div>
                                        @endauth
                                    </div>
                                </div>
                            </div>`;
                        });
                        $("#provider_activ").html(html_slots);
                    } else {
                        error_modal(data.error);
                    }
                    $('#provider_activ').fadeIn(300);
                },
                error: function(msg) {
                    console.log(msg);
                }
            });
        }, 300);
    }
}

