                                    <div class="all_games_item_img_button">
                                        @auth
                                        <div class="all_games_item_img_button_play" data-href="/slot/` + item.id + `/real_dynamics" onclick="dynamics(this);">Играть</div>
                                        <div class="all_games_item_img_button_demo" data-href="/slot/` + item.id + `/demo_dynamics" onclick="dynamics(this);">Демо</div>
                                        @else
                                        <div class="all_games_item_img_button_demo all_games_item_img_button_demo_auto" data-href="/slot/` + item.id + `/demo_dynamics" onclick="dynamics(this);">Демо</div>
                                        @endauth
                                    </div>
                                </div>
                            </div>`;
                    });
                    $("#provider_activ").html(html_slots);
                } else {
                    error_modal(data.error);
                }

                $('#provider_activ').fadeIn(300);
            },
            error: function(msg) {
                console.log(msg);
            }
        });
    }, 300);
});

setTimeout(function() {
    $(".video_button svg").slideDown(400);
}, 3600);
</script>
